  `Id` int(6) NOT NULL,
  `Seq` int(6) NOT NULL DEFAULT '1',
  `MainTaskId` int(4) NOT NULL,
  `UserId` smallint(4) NOT NULL,
  `Content` varchar(1024) NOT NULL,
  `ValidFrom` datetime NOT NULL,
  `ValidUntil` datetime NOT NULL DEFAULT '2500-01-01 00:00:00',
  `UpdateId` smallint(6) NOT NULL,
  `Status` char(1) NOT NULL DEFAULT 'A',
  PRIMARY KEY (`Id`,`Seq`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

